// initialState 초기 상태값
const initialState = {
    todos: [
        {
            id : 1,
            name : '밥 먹기',
            contents : '밥 열심히 먹기',
            inSuccess : false,
        },
        {
            id : 2,
            name : '잠 자기',
            contents : '잠 열심히 자기',
            inSuccess : false,
        },
    ]
};

// Reducer
const todos = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state;
    }
};

export default todos;
